import React from "react";
import {
  Typography,
  Grid,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
} from "@material-ui/core";
import styles from "./Work.module.css";

const PortfolioComponents = ({ title, img, details }) => {
  return (
    <Grid item xs={12} sm={6} md={4}>
      <Card className={styles.card}>
        <CardActionArea>
          <CardMedia
            className={styles.img}
            component="img"
            alt="image1"
            height="140"
            image={img}
            title="Restaraunt App"
          />
          <CardContent>
            <Typography
              className={styles.cardTitle}
              gutterBottom
              variant="h5"
              component="h2"
            >
              {title}
            </Typography>
            <Typography
              className={styles.details}
              variant="body2"
              color="textSecondary"
              component="p"
            >
              {details}
            </Typography>
          </CardContent>
        </CardActionArea>
        <CardActions>
          <Button
            variant="contained"
            className={styles.btn}
            size="small"
            color="primary"
          >
            <a href="google.com">View</a>
          </Button>
        </CardActions>
      </Card>
    </Grid>
  );
};

export default PortfolioComponents;
